import React from "react";
import LoginButton from "../../components/loginButton";
import styles from "./index.module.css";
import { Center, HStack, Box } from "@chakra-ui/react";
import Subheading from "../../components/subheading";

function Login() {
  return (
    <Center className={styles.container}>
      <img
        className={styles.myImg}
        src="/EngageMateImageTextDark.png"
        alt="EngageMate Logo"
      />
      <h2 className={styles.myText}>
        Your real time remote learning companion
      </h2>
      {/* <Subheading
        className={styles.myImg}
        text={"Your real time remote learning companion"}
      ></Subheading> */}
      <LoginButton className={styles.myBtn} />
    </Center>
  );
}

export default Login;

